export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},y2rhwL55MN:{data:{id:1645,attributes:{imdbId:"tt0178642",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjc1NzQ3NTAzOF5BMl5BanBnXkFtZTYwNDg5Mjg5._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"},{Source:"Rotten Tomatoes",Value:"22%"},{Source:"Metacritic",Value:"40\u002F100"}],item_lang:{data:{id:2308,attributes:{title:e,plot:"In 1975, at age 18, Phoebe is unhappy. When she was about 10, her father died of leukemia; her older sister Faith became a political radical, left for Europe with her boyfriend Wolf, and commits suicide in Portugal a year later. Phoebe, who has romantic ideas about both her father and Faith, decides to trace Faith's steps, find Wolf, and learn what really happened. She finds Wolf in Paris, and he tells her stories of Faith's radical activities, including joining the Red Army in Berlin. Phoebe has visions of her sister, seems close to madness, and may be headed for suicide herself. It's the trip to the cliffs of Portugal that will make the difference: breakthrough or breakdown?",slug:"the-invisible-circus"}}},books:{data:[{id:8522,attributes:{title:e,description:i,thumbnail:j,authors:[a],firstBook:true,published:k,publisher:f,subtitle:c}},{id:8523,attributes:{title:"Jennifer Egan Sampler",description:"A VISIT FROM THE GOON SQUAD A brilliantly entertaining novel about memory, time, art and how humans connect at every level. LOOK AT ME The stunningly well praised second novel raises tantalizing questions about identity and reality in contemporary Western culture. EMERALD CITY Eleven masterful stories, seamless evocations of self-discovery. THE INVISIBLE CIRCUS This spellbinding novel introduces Egan's remarkable ability to tie suspense with deeply insightful characters and the nuances of emotion.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PnGeBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2012-01-01",publisher:"Hachette UK",subtitle:"Emerald City, The Invisible Circus, Look at Me & A Visit From the Goon Squad"}},{id:8524,attributes:{title:e,description:i,thumbnail:j,authors:[a],firstBook:d,published:k,publisher:f,subtitle:c}},{id:8525,attributes:{title:"Why China?",description:"A Vintage Shorts “Short Story Month” Selection Sam Lafferty has hit bottom. Under investigation and on leave from the financial services firm that employed him, Sam has uprooted his wife and two daughters and dragged them against their will to central China. While on this rotten family vacation, in an alien and uncomfortable landscape, after years of deception, lousy investment, moral—and soon-coming financial—bankruptcy, and with his family in tow—Sam pursues the man who had first set him on a path to corruption from crumbling binguan hotels without soap or towels to Buddhist caves near Xi’an. In this dazzling piece, selected from the stunning collection of short fiction Emerald City, by the critically acclaimed author and winner of the Pulitzer Prize and National Book Critics Circle Award, Jennifer Egan lays bare our capacity for failure. An ebook short.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=x1TgCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2016-05-11",publisher:"Vintage",subtitle:c}},{id:8526,attributes:{title:"The Keep",description:"Award-winning author Jennifer Egan brilliantly conjures a world from which escape is impossible and where the keep –the tower, the last stand –is both everything worth protecting and the very thing that must be surrendered in order to survive. Two cousins, irreversibly damaged by a childhood prank, reunite twenty years later to renovate a medieval castle in Eastern Europe. In an environment of extreme paranoia, cut off from the outside world, the men reenact the signal event of their youth, with even more catastrophic results. And as the full horror of their predicament unfolds, a prisoner, in jail for an unnamed crime, recounts an unforgettable story that seamlessly brings the crimes of the past and present into piercing relation.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=W3uNogIseAcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2007-07-10",publisher:f,subtitle:c}}]}}},meta:{}}},prerenderedAt:1681703558889}}("Jennifer Egan","movie","",null,"The Invisible Circus","Anchor","series",1,"In Jennifer Egan’s highly acclaimed first novel, set in 1978, the political drama and familial tensions of the 1960s form a backdrop for the world of Phoebe O’Connor, age eighteen. Phoebe is obsessed with the memory and death of her sister Faith, a beautiful idealistic hippie who died in Italy in 1970. In order to find out the truth about Faith’s life and death, Phoebe retraces her steps from San Francisco across Europe, a quest which yields both complex and disturbing revelations about family, love, and Faith’s lost generation. This spellbinding novel introduced Egan’s remarkable ability to tie suspense with deeply insightful characters and the nuances of emotion.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9bNbqCL8fvEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2010-09-29"))